import React from "react";
import Link from "next/link";
import Style from "../style/style";
import Footer from "../components/Footer";

class Page2 extends React.Component {
  render() {
    return (
      <div>
        {Style}
        <p>2page</p>
        <Footer back="/" go="./Page3" />
      </div>
    );
  }
}

export default Page2;
